  def decode(bin, :public_key) do
    pKtype =
      case :binary.match(bin, begin_marker()) do
        :nomatch ->
          :openssh_public_key

        _ ->
          :rfc4716_public_key
      end

    decode(bin, pKtype)
  end

  def decode(bin, :rfc4716_public_key) do
    rfc4716_decode(bin)
  end

  def decode(bin, :ssh2_pubkey) do
    ssh2_pubkey_decode(bin)
  end

  def decode(bin, :new_openssh) do
    new_openssh_decode(bin)
  end

  def decode(bin, type) do
    openssh_decode(bin, type)
  end

  def encode(bin, :ssh2_pubkey) do
    ssh2_pubkey_encode(bin)
  end

  def encode(entries, type) do
    :erlang.iolist_to_binary(
      :lists.map(
        fn {key, attributes} ->
          do_encode(type, key, attributes)
        end,
        entries
      )
    )
  end

