  def dh_gex_group(min, n, max, groups) do
    case select_by_keylen(min - 10, n, max + 10, groups) do
      {:ok, {sz, gPs}} ->
        rnd = :rand.uniform(length(gPs))
        {:ok, {sz, :lists.nth(rnd, gPs)}}

      other ->
        other
    end
  end

