  defp select_by_keylen(min, n, max, [{k, _Gs} | groups])
       when k < min do
    select_by_keylen(min, n, max, groups)
  end

  defp select_by_keylen(min, n, max, [{k, gs} | groups])
       when k <= max do
    {:ok, select_by_keylen(min, n, max, groups, {k, gs})}
  end

  defp select_by_keylen(_Min, _N, _Max, _) do
    {:error, :no_group_found}
  end

  defp select_by_keylen(_Min, _N, max, [{k, _Gs} | _Groups], gPprev)
       when k > max do
    gPprev
  end

  defp select_by_keylen(min, n, max, [{k, gs} | groups], {kprev, gsPrev}) do
    cond do
      n == k ->
        {k, gs}

      n > k ->
        select_by_keylen(min, n, max, groups, {k, gs})

      n < k and k - n < n - kprev ->
        {k, gs}

      n < k ->
        {kprev, gsPrev}
    end
  end

  defp select_by_keylen(_Min, _N, _Max, [], gPprev) do
    gPprev
  end

  defp begin_marker() do
    "---- BEGIN SSH2 PUBLIC KEY ----"
  end

  defp end_marker() do
    "---- END SSH2 PUBLIC KEY ----"
  end

  defp rfc4716_decode(bin) do
    lines = :binary.split(bin, "\n", [:global])
    do_rfc4716_decode(lines, [])
  end

  defp do_rfc4716_decode([<<"---- BEGIN SSH2 PUBLIC KEY ----", _::binary>> | lines], acc) do
    do_rfc4716_decode(lines, acc)
  end

  defp do_rfc4716_decode([<<>> | lines], acc) do
    do_rfc4716_decode(lines, acc)
  end

  defp do_rfc4716_decode([], acc) do
    :lists.reverse(acc)
  end

  defp do_rfc4716_decode(lines, acc) do
    {headers, pubKey, rest} =
      rfc4716_decode_lines(
        lines,
        []
      )

    case headers do
      [_ | _] ->
        do_rfc4716_decode(
          rest,
          [{pubKey, [{:headers, headers}]} | acc]
        )

      _ ->
        do_rfc4716_decode(rest, [{pubKey, []} | acc])
    end
  end

  defp rfc4716_decode_lines([line | lines], acc) do
    case :binary.last(line) do
      ?\\ ->
        newLine = :binary.replace(line, "\\", hd(lines), [])
        rfc4716_decode_lines([newLine | tl(lines)], acc)

      _ ->
        rfc4716_decode_line(line, lines, acc)
    end
  end

  defp rfc4716_decode_line(line, lines, acc) do
    case :binary.split(line, ":") do
      [tag, value] ->
        rfc4716_decode_lines(
          lines,
          [
            {string_decode(tag), unicode_decode(value)}
            | acc
          ]
        )

      _ ->
        {body, rest} = join_entry([line | lines], [])

        {:lists.reverse(acc),
         rfc4716_pubkey_decode(:base64.mime_decode(:erlang.iolist_to_binary(body))), rest}
    end
  end

  defp join_entry([<<"---- END SSH2 PUBLIC KEY ----", _::binary>> | lines], entry) do
    {:lists.reverse(entry), lines}
  end

  defp join_entry([line | lines], entry) do
    join_entry(lines, [line | entry])
  end

  defp rfc4716_pubkey_decode(binKey) do
    ssh2_pubkey_decode(binKey)
  end

  def new_openssh_decode(
        <<"openssh-key-v1", 0, _L1::size(32)-unsigned-big-integer, cipherName::size(_L1)-binary,
          _L2::size(32)-unsigned-big-integer, kdfName::size(_L2)-binary,
          _L3::size(32)-unsigned-big-integer, kdfOptions::size(_L3)-binary,
          n::size(32)-unsigned-big-integer, _L4::size(32)-unsigned-big-integer,
          publicKey::size(_L4)-binary, _L5::size(32)-unsigned-big-integer,
          encrypted::size(_L5)-binary, _Rest::binary>>
      ) do
    new_openssh_decode(cipherName, kdfName, kdfOptions, publicKey, n, encrypted)
  end

  defp new_openssh_decode(
         "none",
         "none",
         "",
         _PublicKey,
         1,
         <<checkInt::size(32)-unsigned-big-integer, checkInt::size(32)-unsigned-big-integer,
           _Lt::size(32)-unsigned-big-integer, type::size(_Lt)-binary,
           _Lpu::size(32)-unsigned-big-integer, pubKey::size(_Lpu)-binary,
           _Lpripub::size(32)-unsigned-big-integer, privPubKey::size(_Lpripub)-binary,
           _C1::size(32)-unsigned-big-integer, _Comment::size(_C1)-binary, _Pad::binary>>
       ) do
    case {type, privPubKey} do
      {"ssh-ed25519", <<privKey::size(32)-binary, ^pubKey::size(32)-binary>>} ->
        {:ed_pri, :ed25519, pubKey, privKey}

      {"ssh-ed448", <<privKey::size(57)-binary, ^pubKey::binary>>} ->
        {:ed_pri, :ed448, pubKey, privKey}
    end
  end

  def new_openssh_encode({:ed_pri, _, pubKey, privKey} = key) do
    type = key_type(key)
    checkInt = 17 * 256 + 17
    comment = <<>>

    publicKey =
      <<byte_size(type)::size(32)-unsigned-big-integer, type::binary,
        byte_size(pubKey)::size(32)-unsigned-big-integer, pubKey::binary>>

    cipherName = "none"
    kdfName = "none"
    kdfOptions = <<>>
    blockSize = 8
    numKeys = 1

    encrypted0 =
      <<checkInt::size(32)-unsigned-big-integer, checkInt::size(32)-unsigned-big-integer,
        byte_size(type)::size(32)-unsigned-big-integer, type::binary,
        byte_size(pubKey)::size(32)-unsigned-big-integer, pubKey::binary,
        byte_size(<<privKey::binary, pubKey::binary>>)::size(32)-unsigned-big-integer,
        <<privKey::binary, pubKey::binary>>::binary,
        byte_size(comment)::size(32)-unsigned-big-integer, comment::binary>>

    pad = pad(:erlang.size(encrypted0), blockSize)
    encrypted = <<encrypted0::binary, pad::binary>>

    <<"openssh-key-v1", 0, byte_size(cipherName)::size(32)-unsigned-big-integer,
      cipherName::binary, byte_size(kdfName)::size(32)-unsigned-big-integer, kdfName::binary,
      byte_size(kdfOptions)::size(32)-unsigned-big-integer, kdfOptions::binary,
      numKeys::size(32)-unsigned-big-integer, byte_size(publicKey)::size(32)-unsigned-big-integer,
      publicKey::binary, byte_size(encrypted)::size(32)-unsigned-big-integer, encrypted::binary>>
  end

  def pad(n, blockSize) when n > blockSize do
    pad(rem(n, blockSize), blockSize)
  end

  def pad(n, blockSize) do
    :erlang.list_to_binary(:lists.seq(1, blockSize - n))
  end

  defp openssh_decode(bin, fileType) do
    lines = :binary.split(bin, "\n", [:global])
    do_openssh_decode(fileType, lines, [])
  end

  defp do_openssh_decode(_, [], acc) do
    :lists.reverse(acc)
  end

  defp do_openssh_decode(fileType, [<<>> | lines], acc) do
    do_openssh_decode(fileType, lines, acc)
  end

  defp do_openssh_decode(fileType, [<<"#", _::binary>> | lines], acc) do
    do_openssh_decode(fileType, lines, acc)
  end

  defp do_openssh_decode(:auth_keys = fileType, [line | lines], acc) do
    case decode_auth_keys(line) do
      {:ssh2, {:options, [[options, keyType, base64Enc] | comment]}} ->
        do_openssh_decode(fileType, lines, [
          {openssh_pubkey_decode(keyType, base64Enc),
           decode_comment(comment) ++ [{:options, comma_list_decode(options)}]}
          | acc
        ])

      {:ssh2, {:no_options, [[keyType, base64Enc] | comment]}} ->
        do_openssh_decode(fileType, lines, [
          {openssh_pubkey_decode(keyType, base64Enc), decode_comment(comment)}
          | acc
        ])

      {:ssh1, {:options, [[options, bits, exponent, modulus] | comment]}} ->
        do_openssh_decode(fileType, lines, [
          {ssh1_rsa_pubkey_decode(modulus, exponent),
           decode_comment(comment) ++
             [{:options, comma_list_decode(options)}, {:bits, integer_decode(bits)}]}
          | acc
        ])

      {:ssh1, {:no_options, [[bits, exponent, modulus] | comment]}} ->
        do_openssh_decode(fileType, lines, [
          {ssh1_rsa_pubkey_decode(modulus, exponent),
           decode_comment(comment) ++ [{:bits, integer_decode(bits)}]}
          | acc
        ])
    end
  end

  defp do_openssh_decode(:known_hosts = fileType, [line | lines], acc) do
    case decode_known_hosts(line) do
      {:ssh2, [[hostNames, keyType, base64Enc] | comment]} ->
        do_openssh_decode(fileType, lines, [
          {openssh_pubkey_decode(keyType, base64Enc),
           decode_comment(comment) ++ [{:hostnames, comma_list_decode(hostNames)}]}
          | acc
        ])

      {:ssh1, [[hostNames, bits, exponent, modulus] | comment]} ->
        do_openssh_decode(fileType, lines, [
          {ssh1_rsa_pubkey_decode(modulus, exponent),
           decode_comment(comment) ++
             [{:hostnames, comma_list_decode(hostNames)}, {:bits, integer_decode(bits)}]}
          | acc
        ])
    end
  end

  defp do_openssh_decode(:openssh_public_key = fileType, [line | lines], acc) do
    [[keyType, base64Enc] | comment0] = split_n(2, line, [])

    knownKeyType =
      case keyType do
        "ssh-rsa" ->
          true

        "ssh-dss" ->
          true

        <<"ecdsa-sha2-", curve::binary>> ->
          is_ssh_curvename(curve)

        "ssh-ed25519" ->
          true

        "ssh-ed448" ->
          true

        _ ->
          false
      end

    case comment0 do
      [] when knownKeyType == true ->
        do_openssh_decode(fileType, lines, [
          {openssh_pubkey_decode(keyType, base64Enc), []}
          | acc
        ])

      _ when knownKeyType == true ->
        comment = :string.strip(string_decode(:erlang.iolist_to_binary(comment0)), :right, ?\n)

        do_openssh_decode(fileType, lines, [
          {openssh_pubkey_decode(keyType, base64Enc), [{:comment, comment}]}
          | acc
        ])

      _ when knownKeyType == false ->
        do_openssh_decode(fileType, lines, acc)
    end
  end

  defp decode_comment([]) do
    []
  end

  defp decode_comment(comment) do
    [{:comment, string_decode(:erlang.iolist_to_binary(comment))}]
  end

  defp openssh_pubkey_decode(type, base64Enc) do
    try do
      <<_TL::size(32)-unsigned-big-integer, ^type::size(_TL)-binary, bin::binary>> =
        :base64.mime_decode(:erlang.iolist_to_binary(base64Enc))

      ssh2_pubkey_decode(type, bin)
    catch
      _, _ ->
        {type, :base64.mime_decode(:erlang.iolist_to_binary(base64Enc))}
    end
  end

  defp ssh1_rsa_pubkey_decode(mBin, eBin) do
    r_RSAPublicKey(
      modulus: integer_decode(mBin),
      publicExponent: integer_decode(eBin)
    )
  end

  defp integer_decode(binStr) do
    :erlang.list_to_integer(:erlang.binary_to_list(binStr))
  end

  defp string_decode(binStr) do
    unicode_decode(binStr)
  end

  defp unicode_decode(binStr) do
    :unicode.characters_to_list(binStr)
  end

  defp comma_list_decode(binOpts) do
    commaList = :binary.split(binOpts, ",", [:global])

    :lists.map(
      fn item ->
        :erlang.binary_to_list(item)
      end,
      commaList
    )
  end

  defp do_encode(:rfc4716_public_key, key, attributes) do
    rfc4716_encode(key, :proplists.get_value(:headers, attributes, []), [])
  end

  defp do_encode(type, key, attributes) do
    openssh_encode(type, key, attributes)
  end

  defp rfc4716_encode(key, [], []) do
    :erlang.iolist_to_binary([
      begin_marker(),
      '\n',
      split_lines(:base64.encode(:erlang.iolist_to_binary(ssh2_pubkey_encode(key)))),
      '\n',
      end_marker(),
      '\n'
    ])
  end

  defp rfc4716_encode(key, [], [_ | _] = acc) do
    :erlang.iolist_to_binary([
      begin_marker(),
      '\n',
      :lists.reverse(acc),
      split_lines(:base64.encode(:erlang.iolist_to_binary(ssh2_pubkey_encode(key)))),
      '\n',
      end_marker(),
      '\n'
    ])
  end

  defp rfc4716_encode(key, [header | headers], acc) do
    linesStr = rfc4716_encode_header(header)
    rfc4716_encode(key, headers, [linesStr | acc])
  end

  defp rfc4716_encode_header({tag, value}) do
    tagLen = length(tag)
    valueLen = length(value)

    case tagLen + 1 + valueLen do
      n when n > 68 ->
        numOfChars = 68 - (tagLen + 1)
        {first, rest} = :lists.split(numOfChars, value)
        [tag, ':', first, [?\\], '\n', rfc4716_encode_value(rest), '\n']

      _ ->
        [tag, ':', value, '\n']
    end
  end

  defp rfc4716_encode_value(value) do
    case length(value) do
      n when n > 68 ->
        {first, rest} = :lists.split(68, value)
        [first, [?\\], '\n', rfc4716_encode_value(rest)]

      _ ->
        value
    end
  end

  defp openssh_encode(:openssh_public_key, key, attributes) do
    comment = :proplists.get_value(:comment, attributes, '')
    enc = :base64.encode(:erlang.iolist_to_binary(ssh2_pubkey_encode(key)))
    :erlang.iolist_to_binary([key_type(key), ' ', enc, ' ', comment, '\n'])
  end

  defp openssh_encode(:auth_keys, key, attributes) do
    comment = :proplists.get_value(:comment, attributes, '')
    options = :proplists.get_value(:options, attributes, :undefined)
    bits = :proplists.get_value(:bits, attributes, :undefined)

    case bits do
      :undefined ->
        openssh_ssh2_auth_keys_encode(options, key, comment)

      _ ->
        openssh_ssh1_auth_keys_encode(options, bits, key, comment)
    end
  end

  defp openssh_encode(:known_hosts, key, attributes) do
    comment = :proplists.get_value(:comment, attributes, '')
    hostnames = :proplists.get_value(:hostnames, attributes)
    bits = :proplists.get_value(:bits, attributes, :undefined)

    case bits do
      :undefined ->
        openssh_ssh2_know_hosts_encode(hostnames, key, comment)

      _ ->
        openssh_ssh1_known_hosts_encode(hostnames, bits, key, comment)
    end
  end

  defp openssh_ssh2_auth_keys_encode(:undefined, key, comment) do
    :erlang.iolist_to_binary([
      key_type(key),
      ' ',
      :base64.encode(:erlang.iolist_to_binary(ssh2_pubkey_encode(key))),
      line_end(comment)
    ])
  end

  defp openssh_ssh2_auth_keys_encode(options, key, comment) do
    :erlang.iolist_to_binary([
      comma_list_encode(
        options,
        []
      ),
      ' ',
      key_type(key),
      ' ',
      :base64.encode(:erlang.iolist_to_binary(ssh2_pubkey_encode(key))),
      line_end(comment)
    ])
  end

  defp openssh_ssh1_auth_keys_encode(
         :undefined,
         bits,
         r_RSAPublicKey(modulus: n, publicExponent: e),
         comment
       ) do
    :erlang.iolist_to_binary([
      :erlang.integer_to_list(bits),
      ' ',
      :erlang.integer_to_list(e),
      ' ',
      :erlang.integer_to_list(n),
      line_end(comment)
    ])
  end

  defp openssh_ssh1_auth_keys_encode(
         options,
         bits,
         r_RSAPublicKey(modulus: n, publicExponent: e),
         comment
       ) do
    :erlang.iolist_to_binary([
      comma_list_encode(
        options,
        []
      ),
      ' ',
      :erlang.integer_to_list(bits),
      ' ',
      :erlang.integer_to_list(e),
      ' ',
      :erlang.integer_to_list(n),
      line_end(comment)
    ])
  end

  defp openssh_ssh2_know_hosts_encode(hostnames, key, comment) do
    :erlang.iolist_to_binary([
      comma_list_encode(
        hostnames,
        []
      ),
      ' ',
      key_type(key),
      ' ',
      :base64.encode(:erlang.iolist_to_binary(ssh2_pubkey_encode(key))),
      line_end(comment)
    ])
  end

  defp openssh_ssh1_known_hosts_encode(
         hostnames,
         bits,
         r_RSAPublicKey(modulus: n, publicExponent: e),
         comment
       ) do
    :erlang.iolist_to_binary([
      comma_list_encode(
        hostnames,
        []
      ),
      ' ',
      :erlang.integer_to_list(bits),
      ' ',
      :erlang.integer_to_list(e),
      ' ',
      :erlang.integer_to_list(n),
      line_end(comment)
    ])
  end

  defp line_end('') do
    '\n'
  end

  defp line_end(comment) do
    [' ', comment, '\n']
  end

  defp key_type(r_RSAPublicKey()) do
    "ssh-rsa"
  end

  defp key_type({_, r_Dss_Parms()}) do
    "ssh-dss"
  end

  defp key_type({:ed_pub, :ed25519, _}) do
    "ssh-ed25519"
  end

  defp key_type({:ed_pub, :ed448, _}) do
    "ssh-ed448"
  end

  defp key_type({:ed_pri, :ed25519, _, _}) do
    "ssh-ed25519"
  end

  defp key_type({:ed_pri, :ed448, _, _}) do
    "ssh-ed448"
  end

  defp key_type({r_ECPoint(), {:namedCurve, curve}}) do
    <<"ecdsa-sha2-", :public_key.oid2ssh_curvename(curve)::binary>>
  end

  defp comma_list_encode([option], []) do
    option
  end

  defp comma_list_encode([option], acc) do
    acc ++ ',' ++ option
  end

  defp comma_list_encode([option | rest], []) do
    comma_list_encode(rest, option)
  end

  defp comma_list_encode([option | rest], acc) do
    comma_list_encode(rest, acc ++ ',' ++ option)
  end

  defp ssh2_pubkey_encode(r_RSAPublicKey(modulus: n, publicExponent: e)) do
    <<byte_size("ssh-rsa")::size(32)-unsigned-big-integer, "ssh-rsa"::binary, mpint(e)::binary,
      mpint(n)::binary>>
  end

  defp ssh2_pubkey_encode({y, r_Dss_Parms(p: p, q: q, g: g)}) do
    <<byte_size("ssh-dss")::size(32)-unsigned-big-integer, "ssh-dss"::binary, mpint(p)::binary,
      mpint(q)::binary, mpint(g)::binary, mpint(y)::binary>>
  end

  defp ssh2_pubkey_encode(key = {r_ECPoint(point: q), {:namedCurve, oID}}) do
    curve = :public_key.oid2ssh_curvename(oID)

    <<byte_size(key_type(key))::size(32)-unsigned-big-integer, key_type(key)::binary,
      string(curve)::binary, string(q)::binary>>
  end

  defp ssh2_pubkey_encode({:ed_pub, :ed25519, key}) do
    <<byte_size("ssh-ed25519")::size(32)-unsigned-big-integer, "ssh-ed25519"::binary,
      string(key)::binary>>
  end

  defp ssh2_pubkey_encode({:ed_pub, :ed448, key}) do
    <<byte_size("ssh-ed448")::size(32)-unsigned-big-integer, "ssh-ed448"::binary,
      string(key)::binary>>
  end

  defp ssh2_pubkey_decode(
         <<_TL::size(32)-unsigned-big-integer, type::size(_TL)-binary, bin::binary>>
       ) do
    ssh2_pubkey_decode(type, bin)
  end

  defp ssh2_pubkey_decode(
         "ssh-rsa",
         <<_EL::size(32)-unsigned-big-integer, e::size(_EL)-big-signed-integer-unit(8),
           _NL::size(32)-unsigned-big-integer, n::size(_NL)-big-signed-integer-unit(8)>>
       ) do
    r_RSAPublicKey(modulus: n, publicExponent: e)
  end

  defp ssh2_pubkey_decode(
         "ssh-dss",
         <<_PL::size(32)-unsigned-big-integer, p::size(_PL)-big-signed-integer-unit(8),
           _QL::size(32)-unsigned-big-integer, q::size(_QL)-big-signed-integer-unit(8),
           _GL::size(32)-unsigned-big-integer, g::size(_GL)-big-signed-integer-unit(8),
           _YL::size(32)-unsigned-big-integer, y::size(_YL)-big-signed-integer-unit(8)>>
       ) do
    {y, r_Dss_Parms(p: p, q: q, g: g)}
  end

  defp ssh2_pubkey_decode(
         <<"ecdsa-sha2-", id::binary>>,
         <<_IL::size(32)-unsigned-big-integer, id::size(_IL)-binary,
           _QL::size(32)-unsigned-big-integer, q::size(_QL)-binary>>
       ) do
    {r_ECPoint(point: q), {:namedCurve, :public_key.ssh_curvename2oid(id)}}
  end

  defp ssh2_pubkey_decode(
         "ssh-ed25519",
         <<_L::size(32)-unsigned-big-integer, key::size(_L)-binary>>
       ) do
    {:ed_pub, :ed25519, key}
  end

  defp ssh2_pubkey_decode(
         "ssh-ed448",
         <<_L::size(32)-unsigned-big-integer, key::size(_L)-binary>>
       ) do
    {:ed_pub, :ed448, key}
  end

  defp is_key_field("ssh-dss") do
    true
  end

  defp is_key_field("ssh-rsa") do
    true
  end

  defp is_key_field("ssh-ed25519") do
    true
  end

  defp is_key_field("ssh-ed448") do
    true
  end

  defp is_key_field(<<"ecdsa-sha2-", id::binary>>) do
    is_ssh_curvename(id)
  end

  defp is_key_field(_) do
    false
  end

  defp is_bits_field(part) do
    try do
      :erlang.list_to_integer(:erlang.binary_to_list(part))
    catch
      _, _ ->
        false
    else
      _ ->
        true
    end
  end

  defp split_lines(<<text::size(68)-binary>>) do
    [text]
  end

  defp split_lines(<<text::size(68)-binary, rest::binary>>) do
    [[text, ?\n] | split_lines(rest)]
  end

  defp split_lines(bin) do
    [bin]
  end

  defp decode_auth_keys(line) do
    [first, rest] = :binary.split(line, " ", [])

    case is_key_field(first) do
      true ->
        {:ssh2, decode_auth_keys_ssh2(first, rest)}

      false ->
        case is_bits_field(first) do
          true ->
            {:ssh1, decode_auth_keys_ssh1(first, rest)}

          false ->
            decode_auth_keys(first, rest)
        end
    end
  end

  defp decode_auth_keys(first, line) do
    [second, rest] = :binary.split(line, " ", [])

    case is_key_field(second) do
      true ->
        {:ssh2, decode_auth_keys_ssh2(first, second, rest)}

      false ->
        case is_bits_field(second) do
          true ->
            {:ssh1, decode_auth_keys_ssh1(first, second, rest)}

          false ->
            decode_auth_keys(
              <<first::binary, second::binary>>,
              rest
            )
        end
    end
  end

  defp decode_auth_keys_ssh2(keyType, rest) do
    {:no_options, [keyType | split_n(1, rest, [])]}
  end

  defp decode_auth_keys_ssh2(options, next, rest) do
    {:options, [[options, next] | split_n(1, rest, [])]}
  end

  defp decode_auth_keys_ssh1(options, next, rest) do
    {:options, [[options, next] | split_n(2, rest, [])]}
  end

  defp decode_auth_keys_ssh1(first, rest) do
    {:no_options, [first | split_n(2, rest, [])]}
  end

  defp decode_known_hosts(line) do
    [first, rest] = :binary.split(line, " ", [])
    [second, rest1] = :binary.split(rest, " ", [])

    case is_bits_field(second) do
      true ->
        {:ssh1, decode_known_hosts_ssh1(first, second, rest1)}

      false ->
        {:ssh2, decode_known_hosts_ssh2(first, second, rest1)}
    end
  end

  defp decode_known_hosts_ssh1(hostnames, bits, rest) do
    [[hostnames, bits] | split_n(2, rest, [])]
  end

  defp decode_known_hosts_ssh2(hostnames, keyType, rest) do
    [[hostnames, keyType] | split_n(1, rest, [])]
  end

  defp split_n(0, <<>>, acc) do
    :lists.reverse(acc)
  end

  defp split_n(0, bin, acc) do
    :lists.reverse([bin | acc])
  end

  defp split_n(n, bin, acc) do
    case :binary.split(bin, " ", []) do
      [first, rest] ->
        split_n(n - 1, rest, [first | acc])

      [last] ->
        split_n(0, <<>>, [last | acc])
    end
  end

  defp mpint(x) when x < 0 do
    mpint_neg(x)
  end

  defp mpint(x) do
    mpint_pos(x)
  end

  defp mpint_neg(x) do
    bin = int_to_bin_neg(x, [])
    <<byte_size(bin)::size(32)-unsigned-big-integer, bin::binary>>
  end

  defp mpint_pos(x) do
    bin = int_to_bin_pos(x, [])
    <<mSB, _::binary>> = bin

    cond do
      mSB &&& 128 == 128 ->
        b = <<0, bin::binary>>
        <<byte_size(b)::size(32)-unsigned-big-integer, b::binary>>

      true ->
        <<byte_size(bin)::size(32)-unsigned-big-integer, bin::binary>>
    end
  end

  defp int_to_bin_pos(0, ds = [_ | _]) do
    :erlang.list_to_binary(ds)
  end

  defp int_to_bin_pos(x, ds) do
    int_to_bin_pos(x >>> 8, [x &&& 255 | ds])
  end

  defp int_to_bin_neg(-1, ds = [mSB | _]) when mSB >= 128 do
    :erlang.list_to_binary(ds)
  end

  defp int_to_bin_neg(x, ds) do
    int_to_bin_neg(x >>> 8, [x &&& 255 | ds])
  end

  defp string(x) when is_binary(x) do
    <<byte_size(x)::size(32)-unsigned-big-integer, x::binary>>
  end

  defp string(x) do
    b = :erlang.list_to_binary(x)
    <<byte_size(b)::size(32)-unsigned-big-integer, b::binary>>
  end

  defp is_ssh_curvename(id) do
    try do
      :public_key.ssh_curvename2oid(id)
    catch
      _, _ ->
        false
    else
      _ ->
        true
    end
  end
end
